import React, { useState } from 'react';
import { useAuth } from '../../Context/AuthContext';
import { useNavigate } from 'react-router-dom';

const LoginTest = () => {
  const [formData, setFormData] = useState({
    email: 'admin@aqualink.com',
    password: 'admin123'
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const { login, isAuthenticated, user } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccess('');

    try {
      const result = await login(formData.email, formData.password);
      setSuccess(`Login successful! Welcome, ${result.user.name} (${result.user.role})`);
      
      // Redirect based on role after a short delay
      setTimeout(() => {
        if (result.user.role === 'Admin') {
          navigate('/admin-dashboard');
        } else if (result.user.role === 'Branch Manager') {
          navigate('/branch-manager');
        } else if (result.user.role === 'Factory Manager') {
          navigate('/factory-manager');
        } else if (result.user.role === 'Customer') {
          navigate('/');
        } else if (result.user.role === 'Driver') {
          navigate('/driver-dashboard');
        } else if (result.user.role === 'Fire Brigade') {
          navigate('/fire-brigade-dashboard');
        }
      }, 2000);
      
    } catch (error) {
      console.error('Login error:', error);
      setError(error.response?.data?.message || 'Login failed. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const testUsers = [
    { email: 'admin@aqualink.com', password: 'admin123', role: 'Admin' },
    { email: 'factory@aqualink.com', password: 'password123', role: 'Factory Manager' },
    { email: 'colombo@aqualink.com', password: 'password123', role: 'Branch Manager' },
    { email: 'kandy@aqualink.com', password: 'password123', role: 'Branch Manager' },
    { email: 'galle@aqualink.com', password: 'password123', role: 'Branch Manager' }
  ];

  return (
    <div className="min-h-screen bg-gray-50 flex items-center justify-center py-12 px-4 sm:px-6 lg:px-8">
      <div className="max-w-md w-full space-y-8">
        <div>
          <h2 className="mt-6 text-center text-3xl font-extrabold text-gray-900">
            Login Test
          </h2>
          <p className="mt-2 text-center text-sm text-gray-600">
            Test the authentication system
          </p>
        </div>

        {/* Current Status */}
        <div className="bg-white p-4 rounded-lg shadow">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Current Status</h3>
          <p className="text-sm text-gray-600">
            Authenticated: {isAuthenticated() ? 'Yes' : 'No'}
          </p>
          {user && (
            <p className="text-sm text-gray-600">
              User: {user.name} ({user.role})
            </p>
          )}
        </div>

        {/* Login Form */}
        <form className="mt-8 space-y-6" onSubmit={handleSubmit}>
          <div className="rounded-md shadow-sm -space-y-px">
            <div>
              <label htmlFor="email" className="sr-only">Email address</label>
              <input
                id="email"
                name="email"
                type="email"
                autoComplete="email"
                required
                className="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-t-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm"
                placeholder="Email address"
                value={formData.email}
                onChange={handleChange}
              />
            </div>
            <div>
              <label htmlFor="password" className="sr-only">Password</label>
              <input
                id="password"
                name="password"
                type="password"
                autoComplete="current-password"
                required
                className="appearance-none rounded-none relative block w-full px-3 py-2 border border-gray-300 placeholder-gray-500 text-gray-900 rounded-b-md focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 focus:z-10 sm:text-sm"
                placeholder="Password"
                value={formData.password}
                onChange={handleChange}
              />
            </div>
          </div>

          {error && (
            <div className="bg-red-50 border border-red-200 rounded-md p-4">
              <p className="text-sm text-red-800">{error}</p>
            </div>
          )}

          {success && (
            <div className="bg-green-50 border border-green-200 rounded-md p-4">
              <p className="text-sm text-green-800">{success}</p>
            </div>
          )}

          <div>
            <button
              type="submit"
              disabled={loading}
              className={`group relative w-full flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white ${
                loading 
                  ? 'bg-gray-400 cursor-not-allowed' 
                  : 'bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500'
              }`}
            >
              {loading ? 'Signing in...' : 'Sign in'}
            </button>
          </div>
        </form>

        {/* Test Users */}
        <div className="bg-white p-4 rounded-lg shadow">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Test Users</h3>
          <div className="space-y-2">
            {testUsers.map((user, index) => (
              <button
                key={index}
                onClick={() => setFormData({ email: user.email, password: user.password })}
                className="w-full text-left p-2 text-sm bg-gray-50 hover:bg-gray-100 rounded border"
              >
                <div className="font-medium">{user.role}</div>
                <div className="text-gray-600">{user.email}</div>
              </button>
            ))}
          </div>
        </div>

        {/* Navigation */}
        <div className="bg-white p-4 rounded-lg shadow">
          <h3 className="text-lg font-medium text-gray-900 mb-2">Navigation</h3>
          <div className="space-y-2">
            <button
              onClick={() => navigate('/login')}
              className="w-full text-left p-2 text-sm bg-blue-50 hover:bg-blue-100 rounded border"
            >
              Go to Main Login Page
            </button>
            <button
              onClick={() => navigate('/')}
              className="w-full text-left p-2 text-sm bg-green-50 hover:bg-green-100 rounded border"
            >
              Go to Homepage
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginTest;
